import React, { Component } from "react";

export default class BlockQuote extends Component {
  render() {
    const { quote, shadow } = this.props;
    return (
      <div>
        <p>{quote}</p>
        <p>''</p>
        <p>{shadow}</p>
      </div>
    );
  }
}
